import React from 'react'
import DisplayDog from './DisplayDog'

export const Favorites = (props) => {

    console.log(props.favDogs)
    let dogs = []
    props.favDogs.forEach(dogObj => {
        dogs.push(<DisplayFavDog dog={dogObj}/>)
    })

    return(
        <div className="favorites">
            <h1>Favorites</h1>
            {dogs}
        </div>
    )
}
